    true,nt"url": null,nt"notes": "Declassification Mission Application Server
    (DMAS) is a collection of applications that support the department's classification
    mission.  Applications include the electronic Document Review System, electronic
    Publication system, electronic Classification Guidance System, OpenNet, Tracking
    and Distribution System and the Reference Library System.rnrn[Applications include
    the Authorities and Training Tracking System (ATTS) which contains training records
    for individuals who have attended classification training courses and those individuals
    who have been granted official authorities such as Authorized Derivative Classifiers
    and Authorized Derivative De-classifiers , Executive Order Review System (EOReview)
    which contains information for tracking reviews of classified documents, Guidance
    Distribution Tracking System (GDTS) contains information used to distribute classification
    guidance, and Policy Reference Library System (PRL) is a reference library of scanned
    documents relevent to classification policy.]",nt"license_title": "Other License
